import React, {useEffect,useState} from 'react';
//import axios from 'axios';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import { Table, TableContainer, TableHead, TableCell, TableBody, TableRow, Modal, Button, TextField, makeStyles   } from '@material-ui/core';
import {Edit, Delete} from '@material-ui/icons';
import { Contenedor } from "../../Components";




export default function CampeonatosClub() {



    return (
        <div>
            <Contenedor/>
            <div align = "center">
                <Box 
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    p = {1} //padding
                    borderRadius = '8px'
                    border = {2}
                            
                >
                    <h1>Campeonatos</h1>
                </Box>
                <br></br>
                <Box
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    //p = {30} //padding
                    borderRadius = '8px'
                    border = {2}
                >
                   <TableContainer>
                       <Table sx = {{ minWidth: 650 }} arial-label="simple table" id = 'tables'>
                            <TableHead>
                                <TableRow>
                                    <TableCell>Nombre</TableCell>
                                    <TableCell>ID</TableCell>
                                    <TableCell>Fecha Inicio</TableCell>
                                    <TableCell>Fecha Termino</TableCell>
                                </TableRow>
                            </TableHead>
                       </Table>
                   </TableContainer>
                </Box>

            </div>
        </div>
    )
}
